        </MDBTableBody>
      </MDBTable></MDBCardBody></MDBCard>






    </div>
  <p></p>
  <MDBBtn onClick={()=>Props.history.push(`/CalculationCustomers`)}>לסיווג הלקוחות</MDBBtn>
  

